tables.table_schema:
CREATE TABLE social_media_campaigns (
    campaign_id INT PRIMARY KEY,
    campaign_name TEXT,
    start_date DATE,
    end_date DATE
);

CREATE TABLE Impressions (
    impression_id INT PRIMARY KEY,
    ad_id INT,
    impression_date DATE,
    user_id INT
);

CREATE TABLE Clicks (
    click_id INT PRIMARY KEY,
    ad_id INT,
    click_date DATE,
    user_id INT
);
